import React from 'react';

const Item = (props) => {
   
    let q = props.myArray.map((item, index) => (
        <p key={index}>{item}</p>
      ))
   

    return (
        <div>
           <div>f
           {q}
            f
           </div>
        </div>
    );
};

export default Item;
